  /**
   * Displays the PDF certificate using a native PDF viewer.
   *
   * @todo: Find an appropriate name for this function.
   */
   downloadCertificate(): void {
    console.log('platform: ', this.platform);
    console.log('dataDir: ', this.file.dataDirectory);

    if (this.platform.is('cordova')) {
      this.pdfDoc.getBuffer((buffer) => {
        const blob = new Blob([buffer], { type: 'application/pdf'});

        // save the PDF to the data directory of this app
        this.file.writeFile(
          this.file.dataDirectory, 'Digital_identification.pdf',
          blob, {replace: true}
        ).then((fileEntry) => {

          if (this.platform.is('android')) {
            this.fileOpener.open(fileEntry.nativeURL, 'application/pdf')
              .then(() => console.log('File is opened'))
              .catch((err) => console.log('Error opening file: ', err));
          } else {
            // Use Document viewer for iOS for a better UI
            // @todo: change title to something more appropriate - course name + user's name??
            const options: DocumentViewerOptions = {
              title: 'My Certificate'
            };
            this.docViewer.viewDocument(fileEntry.nativeURL, 'application/pdf', options);
          }
        });
      });
    } else {
      // user running browser
      // this.pdfDoc.download();
      this.pdfDoc.open();
      
    }
  }



